import "./MockUniswapV2Factory.sol";

contract MockUniswapV2Router is IUniswapV2Router02 {
    address private _factoryAddress;
    address private _wethAddress;

    constructor() {
        _factoryAddress = address(new MockUniswapV2Factory()); // Create a mock factory
        _wethAddress = address(this); // Use this contract as WETH for simplicity
    }

    function factory() external pure override returns (address) {
        return address(0x1234); // Return a fixed address for testing
    }

    function WETH() external pure override returns (address) {
        return address(0x5678); // Return a fixed address for testing
    }

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external override returns (uint amountA, uint amountB, uint liquidity) {
        // Simplified implementation for testing
        return (amountADesired, amountBDesired, 1000);
    }

    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable override returns (uint amountToken, uint amountETH, uint liquidity) {
        // Simplified implementation for testing
        return (amountTokenDesired, msg.value, 1000);
    }

    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external override returns (uint amountA, uint amountB) {
        // Simplified implementation for testing
        return (1000, 1000);
    }

    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external override returns (uint amountToken, uint amountETH) {
        // Simplified implementation for testing
        return (1000, 1000);
    }

    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external override returns (uint[] memory amounts) {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = amountIn;
        amounts[1] = amountIn * 997 / 1000; // 0.3% fee
        return amounts;
    }

    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    ) external override returns (uint[] memory amounts) {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = amountOut * 1003 / 997; // Reverse calculation
        amounts[1] = amountOut;
        return amounts;
    }

    function swapExactETHForTokens(uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        payable
        override
        returns (uint[] memory amounts)
    {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = msg.value;
        amounts[1] = msg.value * 997 / 1000; // 0.3% fee
        return amounts;
    }

    function swapTokensForExactETH(uint amountOut, uint amountInMax, address[] calldata path, address to, uint deadline)
        external
        override
        returns (uint[] memory amounts)
    {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = amountOut * 1003 / 997; // Reverse calculation
        amounts[1] = amountOut;
        return amounts;
    }

    function swapExactTokensForETH(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        override
        returns (uint[] memory amounts)
    {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = amountIn;
        amounts[1] = amountIn * 997 / 1000; // 0.3% fee
        return amounts;
    }

    function swapETHForExactTokens(uint amountOut, address[] calldata path, address to, uint deadline)
        external
        payable
        override
        returns (uint[] memory amounts)
    {
        // Simplified implementation for testing
        amounts = new uint[](2);
        amounts[0] = amountOut * 1003 / 997; // Reverse calculation
        amounts[1] = amountOut;
        return amounts;
    }

    function quote(uint amountA, uint reserveA, uint reserveB) external pure override returns (uint amountB) {
        return amountA * reserveB / reserveA;
    }

    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure override returns (uint amountOut) {
        uint amountInWithFee = amountIn * 997;
        uint numerator = amountInWithFee * reserveOut;
        uint denominator = reserveIn * 1000 + amountInWithFee;
        return numerator / denominator;
    }

    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) external pure override returns (uint amountIn) {
        uint numerator = reserveIn * amountOut * 1000;
        uint denominator = (reserveOut - amountOut) * 997;
        return (numerator / denominator) + 1;
    }

